ed': datetime.datetime(2022, 9, 6, 14, 30, 34, tzinfo=datetime.timezone.utc), 'commenter': 'sigurdm', 'type': 'User'}, {'comment_id': 963784284, 'comment_body': 'Good point', 'comment_created': datetime.datetime(2022, 9, 6, 14, 30, 47, tzinfo=datetime.timezone.utc), 'commenter': 'sigurdm', 'type': 'User'}, {'comment_id': 963792798, 'comment_body': '> Is turning an Iterable into a List beneficial for cases where it is accessed more than once?
It will avoid calculating the condition twice - for very simple conditions calculating twice might be cheaper than allocating the list:

```
main() {
  final x = [1,2,3].where((x) {
    print(x);
    return x.isOdd;
  });
  x.toList();
  x.toList();
}
```
prints
```
1
2
3
1
2
3
```

while
```dart
main() {
  final x = [1,2,3].where((x) {
    print(x);
    return x.isOdd;
  }).toList();
  x.toList();
  x.toList();
}
```
prints:
```
1
2
3
```

> Or is there also a performance penalty associated with chaining .where() calls?

You would have to benchmark, but I very much doubt that the compiler can optimize chained `.where()` calls.

That means chained where calls has the overhead of invoking a closure (up to) twice as often. I think it is better to combine the conditions if performance is a concern.


